import { Box, Grid, Typography, Button } from "@material-ui/core";

export default props => {
    <box bgcolor ="secondary.main" color="white">
        <Typography variant="h5">Job Listing</Typography>
        <Button variant="contained">Search</Button>
    </box>

}
